import { useState } from 'react';
import axios from 'axios';

const Create = () => {
    const [form, setForm] = useState({});

    const handleForm = (e) => {
        let name = e.target.name;
        let value = e.target.value;

        setForm(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    const submitForm = () => {
        axios.post()
        .then()
        .catch()
    };  
    return (<h2>Hi from create</h2>);
};

export default Create;
